import React from 'react'
import { useNavigate } from 'react-router-dom'

const Dashboard = () => {
  const navigate = useNavigate();
  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login")
  }
  
  return (
    <div>
      <h2>Dashboard</h2>
      <button type="button" onClick={handleLogout}>Log Out</button>
    </div>
  )
}

export default Dashboard
